package uz.pdp.uiexam

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.recyclerview.widget.GridLayoutManager
import androidx.recyclerview.widget.LinearLayoutManager
import androidx.recyclerview.widget.RecyclerView
import uz.pdp.uiexam.*
import java.util.ArrayList
import kotlin.random.Random

class HomeFragment : Fragment() {

    private lateinit var categoryRecyclerView: RecyclerView
    private lateinit var restaurantRecyclerView: RecyclerView

    private lateinit var categoryAdapter: CategoryAdapter
    private lateinit var restaurantsAdapter: RestaurantsAdapter

    override fun onCreateView(
        inflater: LayoutInflater,
        container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        return inflater.inflate(R.layout.fragment_home, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {

        categoryRecyclerView = view.findViewById(R.id.rvHomeCategory)
        restaurantRecyclerView = view.findViewById(R.id.rvHomeRestaurants)

        categoryRecyclerView.layoutManager =
            LinearLayoutManager(requireActivity(), LinearLayoutManager.HORIZONTAL, false)

        restaurantRecyclerView.layoutManager = GridLayoutManager(requireActivity(), 2)

        refreshCategory()

        refreshRestaurant()
    }

    private fun refreshRestaurant() {
        restaurantsAdapter = RestaurantsAdapter(requireActivity(), getAllRestaurants())
        restaurantRecyclerView.adapter = restaurantsAdapter
    }

    private fun refreshCategory() {
        categoryAdapter = CategoryAdapter(requireActivity(), getAllCategories())
        categoryRecyclerView.adapter = categoryAdapter
    }

    private fun getAllRestaurants(): ArrayList<Restaurant> {
        return ArrayList<Restaurant>().apply {
            for (i in 0..5) {
                this.add(
                    Restaurant(
                        "data:image/jpeg;base64,",
                        "Gamine",
                        "1231 Fillmore St  ",
                        randomRating().toFloat(),
                        true
                    )
                )
                this.add(
                    Restaurant(
                        "data:image/jpeg;base64,",
                        "DoppieZerro",
                        "444 Fulton St",
                        randomRating().toFloat(),
                        false
                    )
                )
                this.add(
                    Restaurant(
                        "data:image/jpeg;base64,",
                        "Blackwood",
                        "1100 Union St",
                        randomRating().toFloat(),
                        false
                    )
                )
            }
        }
    }

    fun randomRating(): Int = Random.nextInt(1, 5)

    private fun getAllCategories(): ArrayList<Category> {
        return ArrayList<Category>().apply {
            for (i in 0..2) {
                this.add(
                    Category(
                        "data:image/jpeg;base64,",
                        "Restaurant"
                    )
                )
                this.add(
                    Category(
                        "data:image/jpeg;base64,",
                        "Coffee Shops"
                    )
                )
                this.add(
                    Category(
                        "data:image/jpeg;base64,",
                        "Shopping"
                    )
                )
            }
        }
    }
}